import React, { useState, useEffect } from 'react';
import { Table, Modal, Button, Form } from 'react-bootstrap';
import axios from 'axios';
import Sidebar from './Sidebar';
import Topbar from './Topbar';

function AllTestResults() {
  const [testResults, setTestResults] = useState([]);
  const [showModal, setShowModal] = useState(false);
  const [selectedTestResult, setSelectedTestResult] = useState(null);
  const [updatedTestName, setUpdatedTestName] = useState('');
  const [updatedResult, setUpdatedResult] = useState('');

  useEffect(() => {
    // Fetch test results
    axios.get('http://localhost:8080/api/test-results/all')
      .then(response => {
        console.log(response.data);
        setTestResults(response.data);
      })
      .catch(error => {
        console.error('Error fetching test results:', error);
      });
  }, []);

  const handleUpdate = (testResult) => {
    setSelectedTestResult(testResult);
    setShowModal(true);
  };

  const handleCloseModal = () => {
    setShowModal(false);
    setUpdatedTestName('');
    setUpdatedResult('');
  };

  const handleUpdateSubmit = () => {
    // Update test results
    axios.put(`http://localhost:8080/api/test-results/${selectedTestResult.testResultId}`, {
      testName: updatedTestName,
      result: updatedResult
    })
    .then(response => {
      console.log('Test result updated successfully:', response.data);
      // Refresh test results after update
      axios.get('http://localhost:8080/api/test-results/all')
        .then(response => {
          setTestResults(response.data);
        })
        .catch(error => {
          console.error('Error fetching updated test results:', error);
        });
      handleCloseModal();
    })
    .catch(error => {
      console.error('Error updating test result:', error);
    });
  };

  return (
    <div className="d-flex">
      <Sidebar />
      <div className="flex-grow-1">
        <Topbar />
        <div className="p-4 mt-5">
          <h2>Test Results</h2>
          <Table striped bordered hover>
            <thead>
              <tr>
                <th>Test Name</th>
                <th>Result</th>
                <th>Patient Details</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {testResults.length > 0 ? (
                testResults.map(testResult => (
                  <tr key={testResult.testResultId}>
                    <td>{testResult.testName}</td>
                    <td>{testResult.result}</td>
                    <td>
                      <p> {testResult.patient.firstName} {testResult.patient.lastName}</p>
                      <p>{testResult.patient.contactNumber}</p>
                    </td>
                    <td>
                      <Button variant="info" onClick={() => handleUpdate(testResult)}>Update</Button>
                    </td>
                  </tr>
                ))
              ) : (
                <tr>
                  <td colSpan="4">No test results available</td>
                </tr>
              )}
            </tbody>
          </Table>
          <Modal show={showModal} onHide={handleCloseModal}>
            <Modal.Header closeButton>
              <Modal.Title>Update Test Result</Modal.Title>
            </Modal.Header>
            <Modal.Body>
              <Form.Group controlId="updatedTestName">
                <Form.Label>Test Name</Form.Label>
                <Form.Control type="text" value={updatedTestName} onChange={(e) => setUpdatedTestName(e.target.value)} />
              </Form.Group>
              <Form.Group controlId="updatedResult">
                <Form.Label>Result</Form.Label>
                <Form.Control type="text" value={updatedResult} onChange={(e) => setUpdatedResult(e.target.value)} />
              </Form.Group>
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={handleCloseModal}>Cancel</Button>
              <Button variant="primary" onClick={handleUpdateSubmit}>Update</Button>
            </Modal.Footer>
          </Modal>
        </div>
      </div>
    </div>
  );
}

export default AllTestResults;
